import { drizzleReactHooks } from '@drizzle/react-plugin';
import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const { useDrizzle } = drizzleReactHooks;

const Daopropose2 = ({ traductores, longitud }) => {
  const { useCacheCall } = useDrizzle();

  const [selectedOption, setSelectedOption] = useState('');
  const [selectedData2, setSelectedData2] = useState('');
  const [textInput1, setTextInput1] = useState('');
  const [textInput2, setTextInput2] = useState('');

  const handleChange = (event) => {
    const selectedIndex = event.target.selectedIndex;
    setSelectedOption(event.target.value);
    setSelectedData2(traductores[selectedIndex]?.data2 || '');
  };

  return (
    <div>
      <form>
        <label>
          Selecciona una opción:
          <select value={selectedOption} onChange={handleChange}>
            <option value="">Seleccionar</option>
            <option value="option1">Opción 1</option>
            <option value="option2">Opción 2</option>
            <option value="option3">Opción 3</option>
            <option value="option4">Opción 4</option>
          </select>
        </label>
      </form>

      {selectedOption === 'option1' && (
        <div>
          <p>Desplegable:</p>
          <form>
            <label>
              Selecciona un traductor:
              <select value={selectedData2} onChange={handleChange}>
                <option value="">Seleccionar</option>
                {Array.from({ length: longitud }, (_, i) => (
                  <option key={i} value={traductores[i]?.data1}>
                    {traductores[i]?.data1}
                  </option>
                ))}
              </select>
            </label>
          </form>
        </div>
      )}

      {selectedOption === 'option2' && (
        <div>
          <p>Desplegable:</p>
          <form>
            <label>
              Selecciona un traductor:
              <select value={selectedData2} onChange={handleChange}>
                <option value="">Seleccionar</option>
                {Array.from({ length: longitud }, (_, i) => (
                  <option key={i} value={traductores[i]?.data1}>
                    {traductores[i]?.data1}
                  </option>
                ))}
              </select>
            </label>
          </form>
        </div>
      )}

      {selectedOption === 'option3' && (
        <div>
          <p>Casilla de texto 1:</p>
          <input
            type="text"
            value={textInput1}
            onChange={(e) => setTextInput1(e.target.value)}
          />
          <p>Casilla de texto 2:</p>
          <input
            type="text"
            value={textInput2}
            onChange={(e) => setTextInput2(e.target.value)}
          />
        </div>
      )}

      {selectedOption === 'option4' && (
        <div>
          <p>Casilla de texto 1:</p>
          <input
            type="text"
            value={textInput1}
            onChange={(e) => setTextInput1(e.target.value)}
          />
          <p>Casilla de texto 2:</p>
          <input
            type="text"
            value={textInput2}
            onChange={(e) => setTextInput2(e.target.value)}
          />
        </div>
      )}

      <p>data1 seleccionada: {selectedData2}</p>
      <p>Texto 1: {textInput1}</p>
      <p>Texto 2: {textInput2}</p>
    </div>
  );
};

export default Daopropose2;
